import React from "react";
import lodgingData from "../../data/lodging.json";
import "../styles/tags.sass"

function Tags() {
  if (!lodgingData || !lodgingData.tags) {
    return null; // Gérez le cas où les données ne sont pas disponibles
  }

  const tags = lodgingData.tags.map((element, index) => (
    <div className='tagLodging' key={"tagsLodg-" + index}> {element}</div>
  ));

  return (
    <ul className="TagsElement">
      <li>{tags}</li>
    </ul>
  );
}

export default Tags;
